import React, { useState } from 'react'




const App = () => {

    const pastTime = new Date().toLocaleTimeString();

    // const state = useState();

    const [time, setTime] = useState(pastTime);

    const RealTime = () => {
        setTime(pastTime);
    };
    const [count, setCount] = useState(0);

    const IncNum = () => {
        setCount(count + 1);
    };




    return (
        <>

            <h1>{count}</h1>
            <button onClick={IncNum}>Click Me</button>
            <p>{time}</p>
            <button onClick={RealTime}>Get Time</button>
        </>
    )
}

export default App
